CREATE TABLE IF NOT EXISTS gd_google_taxonomy (
	id int(11) NOT NULL auto_increment,
	name varchar(128) default NULL,
	parent_id int(11) default NULL,
	updated_at datetime default NULL,created_at datetime default NULL,
	created_user_id int(11) default NULL,
	visible tinyint(4) default NULL,
	flat_path varchar(256) default NULL,
	PRIMARY KEY  (id)
) ENGINE=MyISAM AUTO_INCREMENT=4633 DEFAULT CHARSET=latin1;


